import React from 'react'

const tasks = [
    {
        id: 1,
        text: "Doctors Appointment",
        day: "5th Fab 2020",
        reminder: true,
    },
    {
        id: 2,
        text: "Play Football",
        day: "12th Fab 2020",
        reminder: true,
    },
    {
        id: 3,
        text: "Study Geography",
        day: "23th Fab 2020",
        reminder: false,
    }
];
const Tasks = () => {
  return (
    <>
      {tasks.map( (task) => {<h3>{task.text}</h3>} )}
    </>
  )
}

export default Tasks
